UI handlers that can handle the interaction with human users must register a UIHandler. The bus will use this interface for realizing the protocols between the bus and the handler. 
@link #addNewRegParams(String, UIHandlerProfile)} and {@link #removeMatchingRegParams(String, UIHandlerProfile)}).
@return An ID for this bus member that is used as a kind of "password" of the handler. It must be passed to the bus when calling the other bus methods.

